import React from 'react';
import Typewriter from 'typewriter-effect';

const Intro = () => {

    return(
        <div className="text_name">
            {/* <h1>Hi there, <br/> I am <span className="text_name">Bharat Nair</span></h1>    */}
            <Typewriter

       onInit={(typewriter)=> {

       typewriter

       .typeString("I'm Bharat Nair")

       .pauseFor(1000)
       .deleteAll()
       .typeString("I am a")
       .start();
       }}
       />           
        </div>  
    );
}

export default Intro;
